def count_mutations(first_dna: str, second_dna: str) -> int:
    mutations = 0
    for index, symbol in enumerate(first_dna):
        if symbol != second_dna[index]:
            mutations += 1
    return mutations
    
if __name__ == '__main__':
    dataset = [
        '',
        ''
    ]
    result = count_mutations(*dataset)
    print(result)